style.css:
@-moz-document domain("youtube.com") {
/* 기본 배경 색상을 어둡게 설정 */
  body, #content, #page-manager, ytd-app, ytd-masthead, ytd-guide-renderer, ytd-mini-guide-renderer, ytd-popup-container, ytd-searchbox, ytd-two-column-browse-results-renderer {
    background-color: #181818 !important;
    color: #ffffff !important;
  }

  /* 헤더 색상 변경 */
  ytd-masthead {
    background-color: #202020 !important;
  }

  /* 비디오 제목 색상 변경 */
  #video-title, .title, .yt-simple-endpoint, a {
    color: #ffffff !important;
  }

  /* 네비게이션 메뉴 색상 변경 */
  ytd-guide-entry-renderer, ytd-mini-guide-entry-renderer, ytd-guide-section-renderer, ytd-guide-collapsible-entry-renderer {
    background-color: #202020 !important;
    color: #ffffff !important;
  }

  /* 비디오 카드 색상 변경 */
  ytd-rich-item-renderer, ytd-video-renderer, ytd-grid-video-renderer {
    background-color: #202020 !important;
    color: #ffffff !important;
  }

  /* 검색 결과 색상 변경 */
  ytd-searchbox {
    background-color: #303030 !important;
    color: #ffffff !important;
  }

  /* 댓글 섹션 색상 변경 */
  ytd-comments, ytd-comment-thread-renderer, ytd-comment-renderer {
    background-color: #202020 !important;
    color: #ffffff !important;
  }

  /* 푸터 색상 변경 */
  ytd-footer-renderer {
    background-color: #202020 !important;
    color: #ffffff !important;
  }

  /* 기타 링크 색상 변경 */
  a {
    color: #ff0000 !important;
  }
}
